import React from "react";
import { Container, Grid, TextField, Typography } from "@material-ui/core";

const style = {
    paper: {
        marginTop : 8,
        display : "flex",
        flexDirection: "column",
        alignItems : "center"
    },
    form: {
        width : "100%",
        marginTop: 20
    }
};



const RegistrarUsuario = () => {
    return(
        <Container component ="main" maxWidth ="md" justify ="center">
            <div style={style.paper}>
                <Typography component="h1" variant="h5">
                    Registro de Usuario
                </Typography>
                <form style={style.form}>
                    <Grid container spacing={2}>

                        <Grid item xs={12} md={6}>
                            <TextField name="txtNombre" variant="outlined" fullWidth label="Ingrese su nombre"/>
                        </Grid>

                        <Grid item xs={12} md={6}>
                            <TextField name="txtApellidos" variant="outlined" fullWidth label="Ingrese sus apellidos"/>
                        </Grid>

                        <Grid item xs={12} md={6}>
                            <TextField name="txtUsername" variant="outlined" fullWidth label="Ingrese su username"/>
                        </Grid>

                        <Grid item xs={12} md={6}>
                            <TextField name="txtPassword" type="pa" variant="outlined" fullWidth label="Ingrese su username"/>
                        </Grid>

                    </Grid>
                </form>
            </div>
        </Container>
    );
}

export default RegistrarUsuario;
